import logo from './logo.svg';
import './App.css';
import Clock from "./components/Clock.js";

function App() {
  return (
    <div>
      <h1>Open ClipHop on another device to sync your clipboards</h1>
      <Clock></Clock>
    </div>
  );
}

export default App;
